void SetEnterpriseUsersProfileDefaults(PolicyMap* policy_map)
{
    if (!policy_map->Get(key::kAllowDinosaurEasterEgg)) {

        policy_map->Set(key::kAllowDinosaurEasterEgg, POLICY_LEVEL_MANDATORY, POLICY_SCOPE_USER, POLICY_SOURCE_ENTERPRISE_DEFAULT, base::Value(false), nullptr);
    }
    if (!policy_map->Get(key::kGenAiDefaultSettings)) {

        policy_map->Set(key::kGenAiDefaultSettings, POLICY_LEVEL_MANDATORY, POLICY_SCOPE_USER, POLICY_SOURCE_ENTERPRISE_DEFAULT, base::Value(1), nullptr);
    }
    if (!policy_map->Get(key::kNTPCustomBackgroundEnabled)) {

        policy_map->Set(
            key::kNTPCustomBackgroundEnabled, POLICY_LEVEL_MANDATORY, POLICY_SCOPE_USER, POLICY_SOURCE_ENTERPRISE_DEFAULT, base::Value(true), nullptr);
    }
    if (!policy_map->Get(key::kShowCastSessionsStartedByOtherDevices)) {

        policy_map->Set(key::kShowCastSessionsStartedByOtherDevices, POLICY_LEVEL_MANDATORY, POLICY_SCOPE_USER, POLICY_SOURCE_ENTERPRISE_DEFAULT,
            base::Value(false), nullptr);
    }
    if (!policy_map->Get(key::kShowFullUrlsInAddressBar)) {

        policy_map->Set(
            key::kShowFullUrlsInAddressBar, POLICY_LEVEL_MANDATORY, POLICY_SCOPE_USER, POLICY_SOURCE_ENTERPRISE_DEFAULT, base::Value(false), nullptr);
    }
}

void SetEnterpriseUsersSystemWideDefaults(PolicyMap* policy_map)
{
    if (!policy_map->Get(key::kDnsOverHttpsMode)) {

        policy_map->Set(key::kDnsOverHttpsMode, POLICY_LEVEL_MANDATORY, POLICY_SCOPE_USER, POLICY_SOURCE_ENTERPRISE_DEFAULT, base::Value("off"), nullptr);
    }
}

void SetEnterpriseUsersDefaults(PolicyMap* policy_map)
{
    SetEnterpriseUsersProfileDefaults(policy_map);
    SetEnterpriseUsersSystemWideDefaults(policy_map);
}
